import "./mission.css";
import missionImg from "../../img/11.jpg"

export default function mission(props){
    return(
    <div className="mission">
        <div className="missionLeft">
            <h1 className="missionTitle">Mission Statement</h1>
            <p className="missionBody">Our mission is that we want to provide the bwsr thibg that we cab in the limited amount of time that we have so that the thing that is to be buid can be benificiary for the socity as a whole in the future</p>
        </div>
        <div className="missionRight">
            <div className="balckBack"></div>
            <img className="missionImg"></img>
        </div>
    </div>
    );
}
